import Link from "next/link";
import styles from "../components/styles/navbar.module.css";

const Links = () => {
  return (
    <ul className={styles.red}>
      <li>
        <Link href="/">
          <a>ასდასდასდ</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
    </ul>
  );
};

export default Links;
